export default function PreliminaryInputComponent({theme,setCustomRange}) {
    return (
        <div style = {{
            display: 'flex',
            flexDirection: 'column',
            alignItems: 'center'
        }}>
            <h1>Enter any number from 0-100</h1>
            <input type = "number">
            </input>
            <button style = {{
                background: 'none',
                border: 'none',
                margin: '5px',
                color: theme.font.regular
            }} onClick = {(e) => setCustomRange(e.target.value)}>Click to Begin</button>
        </div>
    )
}
